.navbar {
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 10px 30px;
  background-color: #333;
}

.navbar-logo, .navbar-links {
  flex: 1;
  text-align: center;
}

.navbar-logo {
  color: #fff;
  font-size: 24px;
}

.navbar-links {
  list-style-type: none;
  padding: 0;
  display: flex;
  gap: 15px;
  justify-content: center;
}

.navbar-link {
  text-decoration: none;
  color: #fff;
  transition: color 0.3s ease;
}

.navbar-link:hover {
  color: #ddd;
}
